/* eslint-disable react/jsx-no-comment-textnodes */
import React, { useState, useContext } from "react";
import {
  CardImg,
  CardTitle,
  CardSubtitle,
  CardBody,
  CardText,
  Row,
  Col,
  Card,
} from "reactstrap";
import styled from "styled-components";
import { Link } from "react-router-dom";
import { birthContext } from "../../context/birth";
import { observer } from "mobx-react-lite";
import { signinUpContext } from "../../context/signinup";
const cardlist = observer((title, index) => {
  console.log(index);
  const birthInfo = useContext(birthContext);
  const signInfo = useContext(signinUpContext);
  console.log();
  const inputBirthNumber = (num) => {
    //console.log(title.num);
    //console.log(key);
    //let a = title.num;
    /*  const d = new Date();
    console.log(d);
    birthInfo.postNumber = num;
    console.log(birthInfo.postNumber);
    console.log(title.num);
    birthInfo.title = "";
    birthInfo.subtitle = "";
    birthInfo.contents = "";
    birthInfo.birth_year = signInfo.memberYear;
    birthInfo.birth_month = signInfo.memberMon;
    birthInfo.birth_day = signInfo.memberDay;
    birthInfo.getContentsSearch();*/
    birthInfo.postNumber = num;

    birthInfo.simpleContentsSearch();
    birthInfo.title = "";
    birthInfo.subtitle = "";
    birthInfo.contents = "";
  };
  const CardTitleSize = styled(CardTitle)`
    font-size: 1.2em;
    font-weight: bold;
  `;
  const LinkFontStyle = styled(Link)`
    color: black;
    text-decoration: none;
    &:hover {
      color: black;
      text-decoration: none !important;
    }
  `;
  //console.log(contents.contents.num);
  //console.log(contents.contents.title);
  console.log(title.title);
  console.log(title.num);
  console.log(title.imgName);
  // console.log(key);
  const loginState = () => {
    /* birthInfo.postNumber = title.num;
    birthInfo.dbContentsName = title.title;
    console.log(birthInfo.postNumber);
    console.log(title.num);
    birthInfo.title = "";
    birthInfo.subtitle = "";
    birthInfo.contents = "";
    birthInfo.birth_year = signInfo.memberYear;
    birthInfo.birth_month = signInfo.memberMon;
    birthInfo.birth_day = signInfo.memberDay;
    birthInfo.getContentsSearch();*/
  };
  return (
    <div>
      {/*첫번째 요소*/}

      <div>
        {signInfo.kakaoId === "" ? (
          <>
            <LinkFontStyle href="/birth">
              <Card
                inverse
                style={{ backgroundColor: "#00D3EE", border: "0px" }}
                onClick={() => inputBirthNumber(title.num)}
              >
                <CardImg
                  top
                  width="100%"
                  src={title.image}
                  alt="Card image cap"
                />
                <CardBody>
                  <CardTitleSize>{title.title}</CardTitleSize>
                </CardBody>
              </Card>
              <br />
            </LinkFontStyle>
          </>
        ) : (
          <>
            <Card
              inverse
              style={{ backgroundColor: "#00D3EE", border: "0px" }}
              onClick={loginState}
            >
              <CardImg
                top
                width="100%"
                src={title.image}
                alt="Card image cap"
              />
              <CardBody>
                <CardTitleSize>{title.title}</CardTitleSize>
              </CardBody>
            </Card>
            <br />
          </>
        )}
      </div>
    </div>
  );
});

export default cardlist;
